import DefaultLayout from '../components/layouts/DefaultLayout';
import Link from 'next/link'
import style from './index.scss';
import ParagraphModule from "../components/modules/ParagraphModule";


/* This route gets hit by default, e.g. your-site.com */
const DefaultPage = () => {
	const paragraphModuleData = content.body.find(
		(item) => item.component === "Paragraph Module"
	);
	return (
		<DefaultLayout>
			<h1>Anders Killander</h1>
			<ul>
				<li>
					<Link href="/welcome"><a>Welcome</a>
					</Link>
				</li>
				<li>
					<Link href="/about"><a>About</a></Link>
				</li>
				<li>
					<Link href="/blog"><a>Blog</a></Link>
				</li>
			</ul>

			{paragraphModuleData ? (
				<ParagraphModule copy={paragraphModuleData.text} />
			) : null}
		</DefaultLayout>
	);
};

export default DefaultPage;
